// src/components/FrontPage.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import '.sty/FrontPage.css'; // Make sure to import the CSS file for styles

function FrontPage() {
  const navigate = useNavigate();

  const goToSignup = () => {
    navigate('/signup');
  };

  const goToLogin = () => {
    navigate('/login');
  };

  return (
    <div className="front-page-container">
      <div className="welcome-message">
        <h1>Welcome to the CSECU family!</h1>
      </div>

      <div className="auth-buttons">
        <button onClick={goToSignup} className="btn">Sign Up</button>
        <button onClick={goToLogin} className="btn">Login</button>
      </div>
    </div>
  );
}

export default FrontPage;
